function MinimizedCardComponent() {
  return (
    <MDBRow className="mb-4 border-bottom pb-2">
    <MDBCol size="3">
      <img
        src="https://mdbcdn.b-cdn.net/img/new/standard/city/041.webp"
        className="img-fluid shadow-1-strong rounded"
